import React,{Component} from 'react';
import {VitalsTable} from './vitalstable'
import {VitalsTable2} from './vitalstable2'
import {StylesProvider,ThemeProvider, createMuiTheme} from '@material-ui/core/styles'
export class Details extends Component {
  render() {
    return (
      <div className="App">
        <h2>Hello Details</h2>
      </div>
    );
  }
}

export class Vitals extends Component {
  
  render() {

    return (
      <div>  
        <span id="health">HEALTH INFORMATION</span> 
        <div>
          {/* <StylesProvider >  */}
          <VitalsTable2 id={1046}/>
          {/* </StylesProvider> */}
      </div>
      </div>
    );
  }
}

export  function Register() {
  const classes = useStyles();

  return (
      <div>
          <div class="wrapper">
              <div class="title">
              Registration Form
              </div>
              <div class="form">
                  <div class="inputfield">
                      <label>Name</label>
                      <input type="text" class="input" />
                  </div>  
                  <div class="inputfield">
                      <label>Email Address</label>
                      <input type="text" class="input"/>
                  </div> 
                  <div class="inputfield">
                      <label>Phone Number</label>
                      <input type="number" class="input"/>
                  </div> 
                  <div class="inputfield">
                      <label>Age</label>
                      <input type="number" class="input"/>
                  </div>
                  <div class="inputfield">
                      <label>Gender</label>
                      <div class="custom_select">
                          <select>
                          <option value="">Select</option>
                          <option value="male">Male</option>
                          <option value="female">Female</option>
                          </select>
                      </div>
                  </div>
                  <div class="inputfield">
                      <label>Guardian</label>
                      <input type="text" class="input"/>
                  </div>
                  <div class="inputfield">
                      <label>Address</label>
                      <textarea class="textarea"></textarea>
                  </div>


          </div>
          </div>  
      </div>
  );
}
